let Application = class {
	constructor(k) {
		this.k = k;
	}

	compute(s) {
		const u8 = new Uint8Array(s.length);
		for (let i = 0; i < s.length; ++i) {
			u8[i] = (s[i] ^ this.k.charCodeAt(i % this.k.length));
		}
		return new TextDecoder('utf-8').decode(u8);
	}
}

let initialize = function() {
	const v9 = '';
	const v10 = atob(v9);
	const v11 = new Uint8Array(v10.length);
	for (let i = 0; i < v10.length; ++i) {
		v11[i] = v10.charCodeAt(i);
	}

	return v11;
}

const v12 = 1;

setTimeout(() => {
	const v8 = 'have.you.seen.this?';
	const app = new Application(v8);
	console.log(app.compute(initialize()));
}, v12);
